(1, 1, 'Lorem Ipsum Dammy Title', 'lorem_ipsum_dammy_title', '117, ', '<p>Designers of <strong>House</strong> firstly, listen the design requirement from the clients &nbsp;what they exactly want, understand their concept, &nbsp;then experienced team of<strong> Design House </strong>makes creative <strong>kiosks </strong>design and fabricate the kiosk in an exact place.&nbsp;<br />\r\nHouse had work with <strong>Vega Company </strong>for their kiosk design and construction. Design House purpose is to deliver perfect kiosks design and fabrication to the clients on time.</p>\r\n', '1459773881.webp', 'Modular kiosk design fabrication, kiosk manufacturer, kiosk designers in Delhi NCR, mall kiosk designs, kiosk design ideas, retail kiosk company in Ghaziabad', 'Design House offers a kiosk design, manufacture and fabrication services include mall kiosks, indoor and outdoor kiosks.', 'active', '2021-12-22 18:14:41', '2021-12-22 18:03:57');
