INSERT INTO `productcategory` (`id`, `name`, `parent_id`, `icon`, `image`, `sort`, `status`, `menu_visible`, `url`, `desc_text`, `searchkeyword`, `metatitle`, `metadescription`, `metakeyword`, `offer`, `percentage`) VALUES
(154, 'Uniforms', 0, '16558760341jpg.jpg', '1668162470images-2022-11-10T220041320jpeg.jpeg', 0, 'Active', 'View', 'uniforms', '<p style=\"line-height: 1.6;\">Crafting uniforms that are extremely comfortable and equally appealing we provide a wide range of Hotel and Restaurant Uniforms. Our range includes, Executive & HOD Suits, Chef Coats, Waiter Uniforms, Housekeeping Uniforms, Front Office Boys & Girls, Culinary and Various others.  Our uniforms uphold the most desired parameters of Top-grade raw materials that are sourced from trusted vendors cut and stitched to perfection by our skilled tailors. Take advantage of new fabric options such as soft microfiber, spun polyester and stretch broadcloth with advanced garment technology including stain release, wrinkle resistance and moisture wicking features. Proper uniforms are functional and professional in providing a professional look for interaction with guests, and also durability to handle all the to-dos the job entails.</p>', '', 'Top Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the top uniform manufacturers in Delhi, India for quality dress material & design. Contact Us Today!!', 'Top Uniform Manufacturers In India, Top Uniform Manufacturers In Delhi, Uniform Manufacturers In Delhi, Uniform Manufacturers In India', 0, 0),
(155, 'Linen', 0, '1667746060120f658cfd7d8399dc474964f260a45cjpgpng.jpg', '1667746131120f658cfd7d8399dc474964f260a45cjpgpng.png', 0, 'Active', 'View', 'linen', '<p><span style=\"font-family: Quintessential; font-size: 16px;\">Choosing our Linen will assure you cosy comforts meet exclusive style to give an ultimate transformation and a blissful sleep to your guest. Our fine linen comes with an ambience to your guest\'s bedding glory. </span></p><p><span style=\"font-family: Quintessential; font-size: 16px;\">We provide Breathable soft 100% pure cotton fabric & the simplest pleasures of brightening up your guest\'s room with variety of Exotic & Classy Bed Sheets, Duvets, Bed & Duvet Covers, Runners, Bed covers, Mattress Toppers & Protectors, Pillows, </span><span style=\"font-family: Quintessential; font-size: 16px;\"> </span><span style=\"font-family: Quintessential; font-size: 16px;\">Cushions & Bolsters etc.</span></p>', '', 'Pure Linen Fabric Supplier In Delhi, India | Mauli Enterprises', 'We are Pure Linen Fabric Supplier In Delhi, India. Choosing our Linen will assure you cosy comforts meet exclusive style to give an ultimate transformation and a blissful sleep to your guest.', 'Linen Supplier In India, Linen Supplier In Delhi, Linen Fabric Supplier In India, Linen Fabric Supplier In Delhi, Pure Linen Fabric Supplier In India, Pure Linen Fabric Supplier In Delhi, Best Linen Supplier In India, Best Linen Supplier In Delhi', 0, 0),
(156, 'Shoes', 0, '1667746196Oxford2jpeg.webp', '1667746522OxfordShoes2jpg.jpg', 0, 'Active', 'View', 'shoes', '<p style=\"line-height: 1.8; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-family: Quintessential; font-size: 16px;\">Lace up to our wide shoe range from Oxford Shoes, Ladies Bellies, Safety Boots & Gum Boots. Made from the finest quality Leather which boasts of strength and durability. The wearer feels extremely comfortable throughout the long working hours. It won\'t matter if you are running around for your board meeting or traveling on a daily basis, our shoe fits well perfect for all your fast moving activities. The stitching is perfectly done with care so that you can rule out the worry of your shoe getting torn in the middle of your work!</span><br></p>', '', 'Shoes Suppliers In Delhi, India | Mauli Enterprises', 'Lace up to our wide shoe range from Oxford Shoes, Ladies Bellies, Safety Boots & Gum Boots. Made from the finest quality Leather which boasts of strength and durability.', 'Shoes Suppliers In Delhi, Shoes Suppliers In India', 0, 0),
(159, 'Hotel Uniforms', 154, '', '1668165504BrandFlex20221104102613png.png', 0, 'Active', 'View', 'hotel-uniform', '<p style=\"line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Crafting uniforms that are extremely comfortable and equally appealing we provide a wide range of Hotel and Restaurant Uniforms. Our range includes, Executive & HOD Suits, Chef Coats, Waiter Uniforms, Housekeeping Uniforms, Front Office Boys & Girls, Culinary and Various others.</p><p style=\"line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Our uniforms uphold the most desired parameters of Top-grade raw materials that are sourced from trusted vendors cut and stitched to perfection by our skilled tailors. Take advantage of new fabric options such as soft microfiber, spun polyester and stretch broadcloth with advanced garment technology including stain release, wrinkle resistance and moisture wicking features. Proper uniforms are functional and professional in providing a professional look for interaction with guests, and also durability to handle all the to-dos the job entails.</p>', '', 'Hotel Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'Mauli Enterprises is one of the reputed and leading hotel uniform manufacturers in Delhi, India. All types of hotel uniform with high quality fabric.', 'Hotel Uniform Manufacturers In Delhi, Hotel Uniform Manufacturers In India', 0, 0),
(160, 'Corporate Uniforms', 154, '1661413908imagesjpeg.jpg', '1668164053images-2022-11-10T220317881jpeg.jpeg', 2, 'Active', 'View', 'corporate-uniform', '<p style=\"line-height: 1.8; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><br></p><p style=\"line-height: 1.8; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Corporate Uniforms make a great impression. Take Advantage of our unique uniforms that are functional and professional in enhancing your brand value etched in your client\'s mind. Elevate status and standards with our tailor made personalised  corporate uniforms which proclaim elegance.Corporate shirts, t-shirts, trouser, tunic, skirts, tie , jacket, blazer, jacket or anything you\'re looking for!<br></p>', '', 'Corporate Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'We are one of the leading Corporate Uniform Manufacturers In Delhi, India. We have high quality and affordable price available.', 'Corporate Uniforms Manufacturers In Delhi, Corporate Uniforms Manufacturers In India', 0, 0),
(161, 'Restaurant Uniforms', 154, '', '1652026010restaurant-uniformjpg.jpg', 0, 'Active', 'View', 'restaurant-uniform', '<p style=\"line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Crafting uniforms that are extremely comfortable and equally appealing we provide a wide range of Hotel and Restaurant Uniforms. Our range includes, Executive & HOD Suits, Chef Coats, Waiter Uniforms, Housekeeping Uniforms, Front Office Boys & Girls, Culinary and Various others.</p><p style=\"line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Our uniforms uphold the most desired parameters of Top-grade raw materials that are sourced from trusted vendors cut and stitched to perfection by our skilled tailors. Take advantage of new fabric options such as soft microfiber, spun polyester and stretch broadcloth with advanced garment technology including stain release, wrinkle resistance and moisture wicking features. Proper uniforms are functional and professional in providing a professional look for interaction with guests, and also durability to handle all the to-dos the job entails.</p>', '', 'Restaurant Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the top Restaurant Uniform Manufacturers In Delhi, India for quality uniform material & design. Contact Us Today!!', 'Restaurant Uniform Manufacturers In Delhi, Restaurant Uniform Manufacturers In India', 0, 0),
(162, 'School Uniforms', 154, '', '1652026266school-uniformjpg.jpg', 0, 'Active', 'View', 'school-uniform', '<p><div class=\"bottom-group mt-5\" style=\"box-sizing: border-box; margin-top: 3rem !important; display: flex; justify-content: space-between; align-items: center; color: rgb(0, 0, 0); font-family: \"Open Sans\", sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"profile-content\" style=\"box-sizing: border-box; color: rgb(0, 0, 0); font-family: \"Open Sans\", sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-size: 14px; line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Crafting uniforms that are extremely comfortable and equally appealing we provide a wide range of Hotel and Restaurant Uniforms. Our range includes, Executive & HOD Suits, Chef Coats, Waiter Uniforms, Housekeeping Uniforms, Front Office Boys & Girls, Culinary and Various others.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-size: 14px; line-height: 1.8; font-family: \"Open Sans\", sans-serif;\">Our uniforms uphold the most desired parameters of Top-grade raw materials that are sourced from trusted vendors cut and stitched to perfection by our skilled tailors. Take advantage of new fabric options such as soft microfiber, spun polyester and stretch broadcloth with advanced garment technology including stain release, wrinkle resistance and moisture wicking features. Proper uniforms are functional and professional in providing a professional look for interaction with guests, and also durability to handle all the to-dos the job entails.</p></div>', '', 'School Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'Mauli Enterprises is the best School Uniforms manufacturers in Delhi, India. All custom uniforms are tailor-made to suit your needs.', 'School Uniform Manufacturers In Delhi, School Uniform Manufacturers In India', 0, 0),
(164, 'Hotel Linen', 155, '', '1652026577hotel-linenjpg.jpg', 0, 'Active', 'View', 'hotel-linen', '<p style=\"line-height: 1.8; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-family: Quintessential; font-size: 16px;\">Choosing our Hotel Linen will assure you cosy comforts meet exclusive style to give an ultimate transformation and a blissful sleep to your guest. Our fine linen comes with an ambience to your guest\'s bedding glory. We provide Breathable soft 100% pure cotton fabric & the simplest pleasures of brightening up your guest\'s room with variety of Exotic & Classy Bed Sheets, Duvets, Bed & Duvet Covers, Runners, Bed covers, Mattress Toppers & Protectors, Pillows, </span><span style=\"font-family: Quintessential; font-size: 16px;\"> </span><span style=\"font-family: Quintessential; font-size: 16px;\">Cushions & Bolsters etc.</span><br></p>', '', 'Hotel Linen Suppliers In Delhi, India | Mauli Enterprises', 'We are the leading Hotel Linen Suppliers In Delhi, India, We carry an extensive collection of premium quality hotel linen with wide ranges of styles that can easily fit your hotel interior.', 'Hotel Linen Suppliers In Delhi, Hotel Linen Suppliers In India', 0, 0),
