(183, 'Housekeeping Items', 0, '1667037123CaneBasket1png.jpeg', '1667037123BambooBasketjpeg.jpeg', 0, 'Active', 'View', 'housekeeping-items', '<p><span style=\"font-family: \"Open Sans\", sans-serif; font-size: 12px; text-align: justify;\">Whether its Beautifully crafted Cane/Bamboo Baskets, Wooden/Plastic Hangers or Wooden Tissue Boxes, the range of housekeeping/ laundry items has a variety of products to give a rich look to your washrooms or guest rooms. Add a sophisticated touch to your ambience with the range that has no match.</span><br></p>', '', 'Housekeeping Items Supplier in Delhi, India | Mauli Enterprises', 'Mauli Enterprises is a leading Housekeeping Items Supplier in Delhi, India. Get a special discount on housekeeping products.', 'Housekeeping Items Supplier in Delhi, Housekeeping Items Supplier in India', 0, 0),
(184, 'Engg. Maintenance Uniforms', 159, '1659429911majpg.', '1667747446Engg1jpg.jpg', 0, 'Active', 'View', 'engineering-uniforms', '<p>Lightweight, Breathable, Stainless and wrinkle resistant finish poly cotton fabric T-shirts , shirts, pants in differing variables offering superior color retention , durability and smart look. </p><p>Comfortable to wear with easy movability and stretch throughout the day or night shifts. Enhancing appearance and better work performance. </p><p>Available in all custom made options to match hotel or company\'s logo to give a premium look to your staff and perfect to carry those tough jobs efficiently.<br></p>', '', 'Engineering Uniforms Manufacturers In Delhi, India | Mauli Enterprises', 'Mauli Enterprises is one of the leading Engineering Uniforms Manufacturers In Delhi, India. All types of engineering uniform with high quality fabric!!', 'Engineering Uniforms Manufacturers In Delhi, Engineering Uniforms Manufacturers In India', 0, 0),
(185, 'Manager Suits', 159, '1659940441manager-suit-500x500png.', '1667747485CP5jpg.jpg', 0, 'Active', 'View', 'manager-suits', '<p>Manager Suits exudes comfort, style and sophistication. Professional life demands power and conveys social meaning through your power clothing. Choose from an array of exclusive tailor made options such as Slim fit, classic fit, modern fit, single breasted, double breasted, single and double vent etc., our suits give amazing fit and boasts dynamic cuts n design. Dress to impress and show elegance. </p>', '', 'Manager Suit Manufacturers in Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the top manager suit and uniform manufacturers in Delhi, India for quality uniform material & design. Contact Us Today!!', 'Manager Suit Manufacturers in Delhi, Manager Suit Manufacturers in India', 0, 0),
(186, 'Driver Uniforms', 159, '', '1667748093Drivers1jpg.jpg', 0, 'Active', 'View', 'drivers-uniform', '<p>Driver\'s Uniform shows duty comes first that\'s the reason we offer easy absorbing soft fabric comfortable to wear uniforms for long working hours. Available in multitude of colors, shapes and designs, in accordance with the diverse requirements of our customers. <br></p>', '', 'Drivers Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'Mauli Enterprises is a leading driver uniform manufacturer in Delhi, India. You can find here different types of driver dress in many styles and high quality.', 'Drivers Uniform Manufacturers In Delhi, Drivers Uniform Manufacturers In India', 0, 0),
(187, 'F&B Uniforms', 159, '1660828387restaurant-waiter-uniform-500x500jpg.', '1667749123restaurant-waiter-uniform-500x500jpg.jpg', 0, 'Active', 'View', 'fb-uniforms', '<p><span>Offering Aprons, chef tops, chef jackets, shirts, t-shirts and pants in a variety of styles. Contemporary<em> unique uniforms for F&B </em>industry be it casual, smart will make your staff stand out  from the others.</span><span><em class=\"hcV4Re nkGKTb\">Uniforms</em> for your team with company\r\n Logo at its best professional stitching. Different pattern. Comfortable fabric for \r\nlong working hours, multiple available options to select. Fast Colour.</span> We assure that while wearing our tailored uniforms your staff will have a boost up confidence to be more  productive and will help  your\r\ncustomers recognize  serving staff making their bar and restaurant \r\nexperience more enjoyable!<span></span></p>', 'F&B, Food and Beverages uniform', 'F&B Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'Leading F&B Uniform Manufacturers In Delhi, India. We offer an extensive collection for F&B Uniform at an affordable price. Buy Now!!', 'F&B Uniform Manufacturers In Delhi, F&B Uniform Manufacturers In India', 0, 0),
(188, 'Business Suits', 160, '1661413819imagesjpeg.', '1668162891CP2jpg.jpg', 0, 'Active', 'View', 'business-suits', '<p>\'I\'m here for business\'... That\'s that simple straightforward..Our suits are cut n\' styled and talk straight business. Speaking of power, authority, ability to take tough decisions comes only when one feels comfortable and confident. We offer the range of affordable fine fabric range with utmost sharp modern fits for both the genders in the corporate meetings, conferences or simply working in office. Choose your formal wear wisely and upscale your professional presence in your work world!<br></p>', '', 'Business Suits Manufacturers In Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the top Business Suits Manufacturers In Delhi, India for quality uniform material & design. Contact Us Today!!', 'Business Suits Manufacturers In Delhi, Business Suits Manufacturers In India', 0, 0);
