mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-fareast-language:EN-IN;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\nQuintessential;mso-fareast-font-family:Quintessential;mso-bidi-font-family:\r\nQuintessential\">Cane & Bamboo Laundry Baskets</span></p><p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\nQuintessential;mso-fareast-font-family:Quintessential;mso-bidi-font-family:\r\nQuintessential\">Beautifully crafted Handwoven Natural Color Wicker, Cane\r\n& Bamboo Baskets. Boasting Durable Strength, they’re super easy Washable and lightweight\r\ntoo. Take pride in displaying Eco-friendly uniqueness to your Laundry, Home Decor, and\r\nStorage or Gifting purpose. </span></p>\r\n\r\n</p>', '', 'Laundry Baskets In Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, Get Laundry Basket at the best price. We are manufacturer and supplier based in Delhi, India. Visit Us Now!!', 'Laundry Baskets In Delhi, Laundry Baskets In India', 0, 0),
(204, 'Hangers', 183, '1667037347WoodenHangers1png.jpg', '1667817632images-2022-11-07T160642355jpeg.jpeg', 0, 'Active', 'View', 'hangers', '<p>Hangers</p>', '', 'Hangers Supplier in Delhi, India | Mauli Enterprises', 'Looking for Die Hanger Supplier in Delhi, India? Mauli Enterprises is the largest supplier of Hanger in Delhi, India.', 'Hangers Supplier in India, Hangers Supplier in India', 0, 0),
(206, 'Hospital Uniforms', 154, '1667547568faviconpng.jpg', '1667747098HospitalUniformsjpg.jpg', 1, 'Active', 'View', 'hospital-uniforms', 'Hospital Uniforms<br>', '', 'Hospital Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'We at Mauli Enterprises, one of the leading Hospital Uniform Manufacturers In Delhi, India. Inquire us to know more about Hospital Uniform.', 'Hospital Uniform Manufacturers In Delhi, India', 0, 0),
(209, 'Security Uniforms', 159, '1667554465luxxyjpg.png', '1667748291SecurityUniformsjpeg.jpeg', 1, 'Active', 'View', 'security-uniforms', '<p><span style=\"color: rgb(105, 114, 123); font-family: &quot;Work Sans&quot;, sans-serif; font-size: 15px;\">There are few industries where clothing is simply crucial. One of these is the security industry, which requires employees to wear specific uniforms.&nbsp;</span><span style=\"color: rgb(105, 114, 123); font-family: &quot;Work Sans&quot;, sans-serif; font-size: 15px;\">With the right uniforms, security personnel also feel important, and part of a professional, elite team.</span></p><p><span style=\"color: rgb(105, 114, 123); font-family: &quot;Work Sans&quot;, sans-serif; font-size: 15px;\">There are many different types of security clothing, including pants, shirts, blazers, ties, and more. These all form part of security uniforms, making it easy for people to recognize security teams. These clothing items are available in different colors, of which blue, white and black are the most popular.</span><span style=\"color: rgb(105, 114, 123); font-family: &quot;Work Sans&quot;, sans-serif; font-size: 15px;\"><br></span></p>', '', 'Security Uniform Manufacturers In Delhi, India | Mauli Enterprises', 'Mauli Enterprises is one of the reputed and leading Security Uniform Manufacturers In Delhi, India. We are manufacturers and Suppliers of All types of Security Uniforms.', 'Security Uniforms Manufacturers In Delhi, Security Uniforms Manufacturers In India', 1, 10),
(215, 'Ladies Bellies', 156, '', '1667896045download1jpg.jpg', 0, 'Active', 'View', 'ladies-bellies', '<p>Ladies Bellies</p>', '', 'Ladies Bellies Supplier In Delhi, India | Mauli Enterprises', 'Mauli Enterprises, A well managed Manufacturer and Supplier of Ladies Bellies Shoes based in Delhi, India. Select from a wide range of Belly Shoes at affordable price.', 'Ladies Bellies Suppliers In Delhi, Ladies Bellies Suppliers In India', 0, 0),
(216, 'Gum Boots', 156, '', '1667899205gum-boots-500x500jpg.jpg', 0, 'Active', 'View', 'gum-boots', '<p>Gum Boots</p>', '', 'Gum Boots Supplier in Delhi, India | Mauli Enterprises', 'Leading supplier of Gum Boots in Delhi India. Buy Kids gum boots at best price in India. Choose from printed, mid-tops & anti skid gumboots.', 'Gum Boots Supplier in Delhi, Gum Boots Supplier in India', 0, 0),
(219, 'Safety Shoes', 156, '', '1667899748safety-shoes-1562998461-4995951jpeg.jpeg', 0, 'Active', 'View', 'safety-shoes', '<p>Safety Shoes</p>', '', 'Safety Shoes Supplier in Delhi, India | Mauli Enterprises', 'We are a leading supplier of industrial safety shoes in Delhi, India. Get in touch with us and get safety shoes at an affordable price.', 'Safety Shoes Supplier in Delhi, Safety Shoes Supplier in India', 0, 0),
(220, 'Oxford Shoes', 156, '1667900219logopng.jpg', '1667900219xoformjpg.jpg', 1, 'Active', 'View', 'oxford-shoes', '<p><span style=\"font-family: Quintessential; font-size: 16px;\">Lace up to our wide shoe range from Oxford Shoes, Ladies Bellies, Safety Boots & Gum Boots. Made from the finest quality Leather which boasts of strength and durability. The wearer feels extremely comfortable throughout the long working hours. It won\'t matter if you are running around for your board meeting or traveling on a daily basis, our shoe fits well perfect for all your fast moving activities. The stitching is perfectly done with care so that you can rule out the worry of your shoe getting torn in the middle of your work!</span><br></p>', 'oxford shoes', 'Oxford Shoes Supplier in Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the leading Oxford Shoes Supplier in Delhi, India. Embrace latest fashion today!', 'Oxford Shoes Supplier in Delhi, Oxford Shoes Supplier in India', 0, 0);
