(221, 'Waist Coats', 160, '', '1667915168WC9jpg.jpg', 0, 'Active', 'View', 'waist-coat', '<p>Waist Coats</p>', '', 'Waist Coat Manufacturers In Delhi, India | Mauli Enterprises', 'At Mauli Enterprises, We are the top Waist Coat Manufacturers In Delhi, India for quality uniform material & design. Contact Us Today!!', 'Waist Coat Manufacturers In Delhi, Waist Coat Manufacturers In India', 0, 0),
(222, 'Bathrobes', 192, '', '1667934191BR3jpg.jpg', 0, 'Active', 'View', 'bathrobe', '<p>Bathrobe</p>', '', 'Bathrobe Linen Suppliers In Delhi, India | Mauli Enterprises', 'We are the leading Bathrobe Linen Suppliers In Delhi, India, We carry an extensive collection of premium quality Bathrobe linen with wide ranges of styles.', 'Bathrobe Linen Suppliers In Delhi, Bathrobe Linen Suppliers In India', 0, 0),
(223, 'Hospital Linen', 155, '', '1667935403hosp5-1jpg.jpg', 0, 'Active', 'View', 'hospital-linen', '<p>Hospital Linen</p>', '', 'Hospital Linen Suppliers In Delhi, India | Mauli Enterprises', 'We at Mauli Enterprises one of the reputed Hospital Linen Suppliers In Delhi, India. We are committed to provide Quality fabrics uniform to all industry.', 'Hospital Linen Suppliers In Delhi, Hospital Linen Suppliers In India', 0, 0),
(224, 'Housekeeping Uniforms', 159, '', '1668066016housekeeping-uniforms-500x500jpg.jpg', 0, 'Active', 'View', 'housekeeping-uniforms', '<p>Housekeeping Uniforms</p>', '', 'Housekeeping Uniforms Manufacturers In Delhi, India | Mauli Enterprises', 'We are recognized manufacturer and supplier of Housekeeping Uniform in Delhi, India. We are into all types of Housekeeping Uniforms!!', 'Housekeeping Uniforms Manufacturers In Delhi, Housekeeping Uniforms Manufacturers In India', 0, 0),
