(229, 'Leatherette Items', 183, '', '1674377413images-2023-01-22T141858012jpeg.jpeg', 0, 'Active', 'View', 'leatherette-items', '<p>Leatherette Items</p><p>When it comes to assessing the scope of leatherette products, the possibilities are endless. Artificial Leather or leatherette is also referred to as faux leather, PU leather, PVC leather.<br></p><p>Being a quality centric organization, we always provide the finest quality assortment of Hotels &amp; Hospitality Leather Product including Bill Folder, Menu Folder, Tissue Boxes, Remote Holders, Leatherette Tray etc. These products are carefully designed and properly finished with the aid of innovative tools under the stern surveillance of expert professionals. Used for keeping documents, bills, menu cards etc, this product is demanded in hospitals, restaurants and hotels. This Hotels &amp; Hospitality Leather Product can be bought from us at affordable prices.<br></p>', '', '', '', '', 0, 0),
(230, 'BedSheets', 191, '1676966918BS3jpg.jpg', '1676966918BS3jpg.jpg', 0, 'Active', 'View', 'bed-sheets', '<p><span style=\"color: rgb(128, 128, 128); font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">White sheets are one effective way for hotels&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(128, 128, 128);\">to prove their standards of cleanliness</span><span style=\"color: rgb(128, 128, 128); font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">. Much like how the wealthy used to wear all white to show that they could afford to keep it clean, hotels use all white linens to show luxury.</span><br></p>', '', '', '', '', 0, 0),
(231, 'Bed Frills', 191, '', '1676967762BF4jpg.jpg', 0, 'Active', 'View', 'bed-frill', '<h1 style=\"margin-top: 0px; margin-bottom: 5px; padding: 0px; font-size: 30px; font-family: &quot;Open Sans&quot;; line-height: 1.35; color: rgb(8, 7, 7); text-align: center;\"><span style=\"font-weight: 700; font-family: &quot;Open Sans&quot;, arial, serif; font-size: 14px;\">A bed skirt or bed frill is a decorative bedding thing that increases the decor of your bed. It is also used to prevents settling dust under the bed and also helps us in hiding the box spring part and other material kept under the bed.</span><br></h1>', '', '', '', '', 0, 0);
